import React from "react";
import "./vaccination.scss";

const Vaccination = () => {
  return (
    <div className="vaccination" style={{ backgroundColor: "#E0E0E0" }}>
      <div className="vaccination-wrapper">
        <div className="vaccination-list">
        </div>
      </div>
    </div>
  );
};

export default Vaccination;
